@Bren4Bassetlaw Three reasons I can see for current wave of UK inflation - in order:
- energy prices, driven by Russian invasion of Ukraine;
- Brexit, because of damage it has done to trade with closest partners;
- COVID, some inflation inevitable after stagnation of economy during lockdowns.
